@Override
public synchronized Set<String> getPendingDeletions() throws IOException {
  deletePendingFiles();
  if (pendingDeletes.isEmpty()) {
    return Collections.emptySet();
  } else {
    return Collections.unmodifiableSet(new HashSet<>(pendingDeletes));
  }
}

